import styled from 'styled-components'; 

export const Container = styled.div`
    width: 100%;
    heigth: 200px;
    display: flex;
    alignItems: center; 
    justifyContent: center;
`

export const ProfilePicture = styled.img`
    width: 130px;
    heigth: 130px;
    border-radius: 50%;
    border: 8px solid #FFF;  
    alignItems: center;
      
`
